		def isEqual(t1, t2):
			if not t1 and not t2:
				return True
			elif not t1 or not t2:
				return False
			else:
				return t1.hash == t2.hash

		if isEqual(s, t): return True
		return s is not None and (self.isSubtree(s.left, t) or self.isSubtree(s.right, t))




